import React from 'react';


const ImageList = (props) => {
    console.log("images"+props.image)
    const images = props.image.map((img)=>{
        console.log('descript:'+img.description)
        return(
            <div>
                <h3>{img.description}</h3>
                <img  key={img.id} src={img.urls.small}/>
            </div>

        )
    })
    return (
        <div>ImageList:{
            images
        }</div>
    );
};
export default ImageList;
